actionConfiguration.body:
() => {
		const objArr = [];
		const tables = GetStockOnHand.data.split("\r\n\r\n");
		for(let t=1;t<tables.length;t++){
			const csvRows = tables[t].split("\r\n");
			const headers = csvRows[0].split(',');
			for(let i = 1; i < csvRows.length; i++) {
            const rowObj = {};
            objArr.push(rowObj);
            const rowArr = csvRows[i].split(',');
            rowArr.forEach((val, index) => {
							if (headers[index]!="" && headers[index]!="result" && headers[index]!="table"){
                rowObj[headers[index]] = val;
							}
            });
      }
		}
		return objArr;
	}

